const axios = require('axios');
import m from 'mithril';

let config;

try {
    config = require('./config.json');
} catch (e) {
    console.log(e);
}

let token = config.dbToken;
let dbURL = 'http://localhost:1337/graphql';

import authModel from './auth';

let dbModel = {
    callDatabase: async (query) => {
        console.log(token);
        let res = await axios({
            method: 'post',
            url: dbURL,
            data: {
                query: query
            },
            headers: {
                jwt: token
            }
        });

        return res.data.data;
    },
    getCities: async () => {
        let query = `{
            cities {
                id,
                name,
                startingfee,
                penaltyfee,
                fee,
                discount,
                bikes {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord,
                    cityid
                }
            }
        }`;

        let cities = await dbModel.callDatabase(query);

        return cities.cities;
    },
    getCity: async (id) => {
        let query = `{
            city (id: ${id}) {
                id,
                name,
                startingfee,
                penaltyfee,
                fee,
                discount,
                bikes {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord,
                    cityid
                }
            }
        }`;

        let city = await dbModel.callDatabase(query);

        return city.city;
    },
    getUser: async (email) => {
        let query = `{
            customer(email: "${email}") {
                id,
                firstname,
                lastname,
                email,
                balance
                paymentmethod
                historylogs {
                    id,
                    bikeid,
                    customerid,
                    starttime,
                    endtime,
                    startxcoord,
                    startycoord,
                    endxcoord,
                    endycoord,
                    payed,
                    cityid
                }
            }
        }`;

        let user = await dbModel.callDatabase(query);

        return user.customer;
    },
    addUser: async (data) => {
        let query = `mutation {
            addCustomer(
                email: "${data.email}",
                firstname: "${data.firstname}",
                lastname: "${data.lastname}",
                balance: 0,
                paymentmethod: "Direct"
            ) {
                id,
                firstname,
                lastname,
                email,
                balance,
                paymentmethod
            }
        }`;

        let user = await dbModel.callDatabase(query);

        return user.addCustomer;
    },
    updateUser: async (data) => {
        let query = `mutation {
            updateCustomer(
                email: "${data.email || authModel.currentUser.email}",
                firstname: "${data.firstname || authModel.currentUser.firstname}",
                lastname: "${data.lastname || authModel.currentUser.lastname}",
                balance: ${data.balance || authModel.currentUser.balance},
                columnToMatch: "email",
                valueToMatch: "${data.email || authModel.currentUser.email}"
            ) {
                id,
                firstname,
                lastname,
                email,
                balance
            }
        }`;

        let user = await dbModel.callDatabase(query);

        return user.updateCustomer;
    },
    getBikes: async () => {
        let query = `{
            bikes {
                id
                available
                velocity
                battery
                xcoord
                ycoord
            }
        }`;

        let bikes = await dbModel.callDatabase(query);

        return bikes.bikes;
    },
    getBike: async (id) => {
        let query =  `{
            bike (id: ${id}) {
                id,
                available,
                velocity,
                battery,
                xcoord,
                ycoord,
                cityid
            }
        }`;

        let bike = await dbModel.callDatabase(query);

        return bike.bike;
    },
    updateBike: async (data) => {
        let query = `mutation {
            updateBike (
                available: ${data.status},
                columnToMatch: "id",
                valueToMatch: "${data.id}"
            ) {
                id,
                available,
                velocity,
                battery,
                xcoord,
                ycoord
            }
        }`;

        let bike = await dbModel.callDatabase(query);

        return bike.updateBike;
    },
    addLogEntry: async (data) => {
        let query =  `mutation {
            addHistory (
                bikeid: ${ data.scooterId },
                customerid: ${ data.userId },
                startxcoord: ${ data.xcoord },
                startycoord: ${ data.ycoord },
                cityid: ${ data.city }
            ) {
                id,
                bikeid,
                customerid,
                starttime,
                endtime,
                startxcoord,
                startycoord,
                endxcoord,
                endycoord,
                startparking,
                endparking,
                payed,
                cityid
                bike {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord
                },
                customer {
                    id,
                    firstname,
                    lastname,
                    email,
                    balance,
                    paymentmethod
                }
            }
        }`;

        let logEntery = await dbModel.callDatabase(query);

        return logEntery.addHistory;
    },
    updateLogPositionAndPayed: async (data) => {
        let query = `mutation {
            updateHistory (
                endxcoord: ${data.xcoord},
                endycoord: ${data.ycoord},
                payed: ${data.payed},
                columnToMatch: "id",
                valueToMatch: "${data.id}"
            ) {
                id,
                bikeid,
                customerid,
                starttime,
                endtime,
                startxcoord,
                startycoord,
                endxcoord,
                endycoord,
                payed,
                cityid,
                startparking,
                endparking,
                bike {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord
                },
                customer {
                    id,
                    firstname,
                    lastname,
                    email,
                    balance,
                    paymentmethod
                }
            }
        }`;

        let log = await dbModel.callDatabase(query);

        return log.updateHistory;
    },
    updateLogPosition: async (data) => {
        let query = `mutation {
            updateHistory (
                endxcoord: ${data.xcoord},
                endycoord: ${data.ycoord},
                columnToMatch: "id",
                valueToMatch: "${data.id}"
            ) {
                id,
                bikeid,
                customerid,
                starttime,
                endtime,
                startxcoord,
                startycoord,
                endxcoord,
                endycoord,
                payed,
                cityid,
                startparking,
                endparking,
                bike {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord
                },
                customer {
                    id,
                    firstname,
                    lastname,
                    email,
                    balance,
                    paymentmethod
                }
            }
        }`;

        let log = await dbModel.callDatabase(query);

        return log.updateHistory;
    },
    updateLogPayed: async (data) => {
        let query = `mutation {
            updateHistory (
                payed: ${data.payed},
                columnToMatch: "id",
                valueToMatch: "${data.id}"
            ) {
                id,
                bikeid,
                customerid,
                starttime,
                endtime,
                startxcoord,
                startycoord,
                endxcoord,
                endycoord,
                payed,
                cityid,
                startparking,
                endparking,
                bike {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord
                },
                customer {
                    id,
                    firstname,
                    lastname,
                    email,
                    balance,
                    paymentmethod
                }
            }
        }`;

        let log = await dbModel.callDatabase(query);

        return log.updateHistory;
    },
    getParkings: async () => {
        let query = `{
            parkingspaces {
                id,
                xcoord,
                ycoord,
                name,
                cityid,
                hascharger,
                city {
                    id,
                    name,
                    startingfee,
                    penaltyfee,
                    fee,
                    discount
                }
                bikes {
                    id,
                    available,
                    velocity,
                    battery,
                    xcoord,
                    ycoord
                },
            }
        }`;

        let parking = await dbModel.callDatabase(query);

        return parking.parkingspaces;
    }
};

export default dbModel;

import m from 'mithril';
const axios = require('axios');

import dbModel from './db';

const dbURL = 'http://localhost:1337/graphql'

var authModel = {
    authorized: false,
    currentUser: {},
    getLoginData: async (id) => {
        let data = await axios({
            method: 'post',
            url: 'http://localhost:666/data',
            headers: {
                token: 'test'
            },
            data: {
                id: id
            },
        })

        return data.data
    },
    login: async (id) => {
        let data = await authModel.getLoginData(id);

        let user = await dbModel.getUser(data.email);

        if (!user) {
            await dbModel.addUser({
                email: data.email,
                firstname: data.name.split(' ')[0],
                lastname: data.name.split(' ')[1]
            });

            user = await dbModel.getUser(data.email);
        }

        authModel.currentUser = user;
    }
}

export default authModel;

const axios = require('axios');
import m from 'mithril';


let dbURL = 'http://localhost:1337/graphql';

import authModel from './auth';
import dbModel from './db';
import utilitiesModel from './utilities';

var scooterModel = {
    id: '',
    currentLog: {},
    inRent: false,
    rentTime: null,
    currentScooter: {},
    allScooters: [],
    allParkings: [],
    getAllScooters: async () => {
        scooterModel.allScooters = await dbModel.getBikes();
        m.redraw();
    },
    getAllParkings: async () => {
        scooterModel.allParkings = await dbModel.getParkings();
        m.redraw();
    },
    rent: async (data) => {
        if (data.currentScooter && data.currentScooter.available === 1) {
            let log = await dbModel.addLogEntry({
                scooterId: data.currentScooter.id,
                userId: data.id,
                xcoord: data.currentScooter.xcoord,
                ycoord: data.currentScooter.ycoord,
                city: data.currentScooter.cityid
            });

            await dbModel.getUser(data.email);

            scooterModel.currentLog = log;

            await dbModel.updateBike({
                id: data.currentScooter.id,
                status: 0
            });
            scooterModel.inRent = true;
            scooterModel.id = '';
            return log;
        }
    },
    unrent: async (data) => {
        scooterModel.inRent = false;

        await dbModel.updateBike({
            id: data.currentScooter.id,
            status: 1
        });

        let log;

        if (data.paymentmethod === 'Direct') {
            log = await dbModel.updateLogPosition({
                id: data.currentLog.id,
                xcoord: data.currentScooter.xcoord,
                ycoord: data.currentScooter.ycoord
            });

            let city = await dbModel.getCity(data.currentLog.cityid);
            let totalPrice = utilitiesModel.calculatePrice({
                startingfee: city.startingfee,
                fee: city.fee,
                discount: city.discount,
                penaltyfee: city.penaltyfee,
                startTime: log.starttime,
                endTime: log.endtime,
                startPosition: log.startparking,
                endPosition: log.endparking,
            });

            if (data.currentUser.balance >= totalPrice) {
                log = await dbModel.updateLogPayed({
                    id: data.currentLog.id,
                    payed: 1
                });

                await dbModel.updateUser({
                    email: data.currentUser.email,
                    firstname: data.currentUser.firstname,
                    lastname: data.currentUser.lastname,
                    balance: data.currentUser.balance -= totalPrice,
                });
            } else {
                log = await dbModel.updateLogPayed({
                    id: data.currentLog.id,
                    payed: 0
                });
            }
        } else if (data.paymentmethod === 'Monthly') {
            log = await dbModel.updateLogPositionAndPayed({
                id: data.currentLog.id,
                xcoord: data.currentScooter.xcoord,
                ycoord: data.currentScooter.ycoord,
                payed: 0
            });
        }

        authModel.currentUser = await dbModel.getUser(data.currentUser.email);

        scooterModel.currentScooter = {};
        scooterModel.currentLog = {};
        scooterModel.rentTime = null;
    },
    handleScan: (err, text) => {
        let element = document.getElementsByClassName('blink');

        for (var i = 0; i < element.length; i++) {
            element[i].classList.remove('gone');
        }

        document.getElementsByTagName("BODY")[0].removeAttribute('style');
        if (document.getElementsByClassName('qr-buttons')[0]) {
            document.getElementsByClassName('qr-buttons')[0].setAttribute('style', 'visibility: hidden;')
        }

        if (window.QRScanner) {
            window.QRScanner.disableLight();
        }


        if (err) {
            return err;
        } else {
            scooterModel.id = text;

            m.redraw();
        }
    }
}

export default scooterModel;

let utilities = {
    calculateTime: (startTime, endTime=new Date()) => {
        let difference = endTime - startTime;

        let ms2s = 1000;
        let s2m = 60;
        let m2h = 60;

        let hours = difference / ms2s / s2m / m2h;
        let minutes = (hours - Math.floor(hours)) * m2h;
        let seconds = (minutes - Math.floor(minutes)) * s2m;



        hours = Math.floor(hours);
        minutes = Math.floor(minutes);
        seconds = Math.floor(seconds);

        hours = (hours < 10) ? `0${hours}` : `${hours}`;
        minutes = (minutes < 10) ? `0${minutes}` : `${minutes}`;
        seconds = (seconds < 10) ? `0${seconds}` : `${seconds}`;

        return `${hours}:${minutes}:${seconds}`
    },
    batteryPercentage: (currentBatteryPercentage) => {
        let className;

        className = (currentBatteryPercentage > 90) ? 'max' :
            (currentBatteryPercentage > 70) ? 'high' :
                (currentBatteryPercentage > 40) ? 'middle' :
                    (currentBatteryPercentage > 20) ? 'low' :
                        (currentBatteryPercentage > 5) ? 'critical' : 'min'

        return className;
    },
    calculatePrice: (data) => {
        let totalPrice = 0;
        let ms2s = 1000;
        let s2m = 60;

        totalPrice += data.startingfee;

        let startTime = new Date(parseInt(data.startTime));
        let endTime = new Date(parseInt(data.endTime));

        let duration = Math.ceil((endTime - startTime) / ms2s / s2m);

        totalPrice += duration * data.fee;

        if (data.startPosition === 'unparked' && data.endPosition === 'parked') {
            totalPrice -= data.discount;
        }

        if (data.endPosition === 'unparked') {
            totalPrice += data.penaltyfee;
        }

        return totalPrice;
    }
}

export default utilities;
